function Slideshow(images) {
    console.log(images.length)
    return (
        <div className="slideshow">
            {images.map(image => <img className="slideshow__img" key={image.toString()} src={image} alt="logement"/>)}
            <i className={images.length === 0 ? "fa fa-chevron-left hide" : "fa fa-chevron-left" }></i>
            <i className={images.length === 0 ? "fa fa-chevron-right" : "fa fa-chevron-right hide"}></i>
        </div>
    )
};

export default Slideshow


